SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( T2.intl_usage = 1 AND T2.card_number LIKE '5300%' );

SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( T2.annual_fee > 0 );

SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( T2.annual_fee = 0 AND T2.intl_usage = 1 );

SELECT T1.*, T2.*, T3.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id LEFT JOIN service_requests AS T3 ON T2.card_number = T3.card_number
WHERE  T1.customer_id = :cid AND ( T2.annual_fee = 0 AND T3.status = 'pending' );

SELECT T1.*, T2.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id
WHERE  T1.customer_id = :cid AND ( T2.card_number LIKE '%9876' );

SELECT T1.*, T2.*, T3.*
FROM   customers AS T1 LEFT JOIN cards AS T2 ON T1.customer_id = T2.customer_id LEFT JOIN service_requests AS T3 ON T2.card_number = T3.card_number
WHERE  T1.customer_id = :cid AND ( T3.status = 'pending' );
